import React from "react";
import "./EditSearch2.css";

function EditSearch2(props) {
  const { editSearch, className } = props;

  return (
    <div className={`edit-search2 ${className || ""}`}>
      <img className="edit-search-12" src={editSearch} />
    </div>
  );
}

export default EditSearch2;
